import {useEffect,useState } from "react";
import { Link, useParams } from "react-router-dom";



function Details(){

  const[data,setData]=useState([])
  const {empid}=useParams()
  useEffect(()=>{
          fetch("http://localhost:3006/details/"+empid)
    .then((res) => {
      return res.json()
    })
    .then((resp) => {
      setData(resp)
    })
  },[])
    
  // useEffect(()=>{
